void mtlCollateSetCodeAndLenInfo( const acp_uint8_t * aSource,
                                  acp_uint32_t        aSourceIdx,
                                  acp_uint16_t      * aCode,
                                  acp_uint16_t      * aLength )
{
/***********************************************************************
 *
 * Description :    length 
 *
 *              ( US7ASCII, KSC5601, MS949    )
 *
 * Implementation :
 *
 *    : 
 *
 *   1. KSC5601  (1) code = 0xb0a1 (2)  : 2
 *   2. MS949    (1) code = 0xb0a1 (2)  : 2
 *
 ***********************************************************************/
    ACE_ASSERT( aSource != NULL );
    ACE_ASSERT( aCode != NULL );
    ACE_ASSERT( aLength != NULL );

    if( ((acp_uint8_t)aSource[aSourceIdx] ) < 0x80 )
    {
        *aLength    = 1;
        *aCode = aSource[aSourceIdx];
    }
    else
    {
        *aLength    = 2;
        *aCode = ( aSource[aSourceIdx] << 8 ) + aSource[aSourceIdx+1];
    }
}

